CREATE TABLE parcela (idParcela number(10) NOT NULL, designacao varchar2(255) NOT NULL UNIQUE, area float(10) NOT NULL, PRIMARY KEY (idParcela));
CREATE TABLE cultura (idCultura number(10) NOT NULL, idPlanta number(10) NOT NULL, idParcela number(10) NOT NULL, dataInicio date NOT NULL, dataFim date, area float(10) NOT NULL, PRIMARY KEY (idCultura));
CREATE TABLE planta (idPlanta number(10) NOT NULL, nome varchar2(255) NOT NULL, especie varchar2(255) NOT NULL, variedade varchar2(255) NOT NULL, idTipoProduto number(10) NOT NULL, idTipoCultura number(10) NOT NULL, PRIMARY KEY (idPlanta));
CREATE TABLE produto (idTipoProduto number(10) NOT NULL, tipoProduto varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idTipoProduto));
CREATE TABLE tipoCultura (idTipoCultura number(10) NOT NULL, tipoCultura varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idTipoCultura));
CREATE TABLE fatorDeProducao (idFatorDeProducao number(10) NOT NULL, nomeComercial varchar2(255) NOT NULL, idTipoFatorDeProducao number(10) NOT NULL, idFormulacao number(10) NOT NULL, PRIMARY KEY (idFatorDeProducao));
CREATE TABLE tipoFatorDeProducao (idTipoFatorDeProducao number(10) NOT NULL, tipoFatorDeProducao varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idTipoFatorDeProducao));
CREATE TABLE formulacao (idFormulacao number(10) NOT NULL, formulacao varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idFormulacao));
CREATE TABLE operacaoAgricola (idOperacao number(10) NOT NULL, dataOperacao date NOT NULL, estadoOperacao number(1) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE colheitaPrevista (idCulturaPrevista number(10) NOT NULL, idCultura number(10) NOT NULL, quantidadePrevista float(10) NOT NULL, dataPrevista date NOT NULL, PRIMARY KEY (idCulturaPrevista));
CREATE TABLE registoEstadoFenologico (dataRegisto date NOT NULL, idCultura number(10) NOT NULL, idEstadoFenologico number(10) NOT NULL, PRIMARY KEY (dataRegisto, idCultura, idEstadoFenologico));
CREATE TABLE estadoFenologico (idEstadoFenologico number(10) NOT NULL, designacao varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idEstadoFenologico));
CREATE TABLE registoFichaTecnica (idFatorDeProducao number(10) NOT NULL, idComponente number(10) NOT NULL, quantidade float(10) NOT NULL, PRIMARY KEY (idFatorDeProducao, idComponente));
CREATE TABLE componente (idComponente number(10) NOT NULL, designacao varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idComponente));
CREATE TABLE setorDeRega (idSetor number(10) NOT NULL, caudalMax number(10) NOT NULL, dataInicio date NOT NULL, dataFim date, PRIMARY KEY (idSetor));
CREATE TABLE setorCultura (idSetor number(10) NOT NULL, idCultura number(10) NOT NULL, dataInicio date NOT NULL, dataFim date, PRIMARY KEY (idSetor, idCultura));
CREATE TABLE modoDeAplicacao (idModoDeAplicacao number(10) NOT NULL, modoDeAplicacao varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idModoDeAplicacao));
CREATE TABLE rega (idOperacao number(10) NOT NULL, idCultura number(10) NOT NULL, horaDeRega_Hora number(10) NOT NULL, horaDeRega_Minuto number(10) NOT NULL, duracao number(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE semeadura (idOperacao number(10) NOT NULL, idCultura number(10) NOT NULL, quantidadeSemeada float(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE plantacao (idOperacao number(10) NOT NULL, idCultura number(10) NOT NULL, numPlantas number(10) NOT NULL, compasso float(10) NOT NULL, distanciaFilas float(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE monda (idOperacao number(10) NOT NULL, idCultura number(10) NOT NULL, area float(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE poda (idOperacao number(10) NOT NULL, idCultura number(10) NOT NULL, QuantidadePodada float(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE fertilizacao (idOperacao number(10) NOT NULL, idCultura number(10) NOT NULL, idModoDeAplicacao number(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE colheita (idOperacao number(10) NOT NULL, idCultura number(10) NOT NULL, quantidadeColhida float(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE incorporacaoSolo (idOperacao number(10) NOT NULL, idParcela number(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE mobilizacaoSolo (idOperacao number(10) NOT NULL, idParcela number(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE operacaoComFator (idOperacao number(10) NOT NULL, area float(10) NOT NULL, PRIMARY KEY (idOperacao));
CREATE TABLE aplicacaoDeFator (idOperacao number(10) NOT NULL, idFatorDeProducao number(10) NOT NULL, quantidade number(10), PRIMARY KEY (idOperacao, idFatorDeProducao));
CREATE TABLE fertirega (idOperacao number(10) NOT NULL, idMix number(10) NOT NULL, PRIMARY KEY (idOperacao, idMix));
CREATE TABLE mix (idMix number(10) NOT NULL, PRIMARY KEY (idMix));
CREATE TABLE receitaDoMix (idMix number(10) NOT NULL, idFatorDeProducao number(10) NOT NULL, quantidade float(10) NOT NULL, idUnidade number(10) NOT NULL, PRIMARY KEY (idMix, idFatorDeProducao));
CREATE TABLE unidade (idUnidade number(10) NOT NULL, unidade varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idUnidade));
CREATE TABLE logDeOperacoes (idOperacao number(10) NOT NULL, idTipoDeOperacao number(10) NOT NULL, dadosOperacao varchar2(255) NOT NULL, instanteDeCriacao timestamp(0) NOT NULL, PRIMARY KEY (idOperacao, idTipoDeOperacao));
CREATE TABLE tipoDeOperacao (idTipoDeOperacao number(10) NOT NULL, designacao varchar2(255) NOT NULL UNIQUE, PRIMARY KEY (idTipoDeOperacao));
CREATE TABLE tabelaAuxiliar (idFatorDeProducao number(10) NOT NULL, quantidade float(10) NOT NULL, idUnidade number(10) NOT NULL, PRIMARY KEY (idFatorDeProducao));
